        <div>
   <ul>
     {props.onSendData.map((item, index) =>{
        //console.log(item)
     return <li className={classes.list}> {item.name} -  {item.description} - {item.price} 
     <Input data={props.onSendData}/>
       </li>
     })} 
     
   </ul>
 </div>
    )

}

export default Items
